let firstPredictionDone = false; // Keep track of whether the first prediction is done
let tempList = []; // Temporary list to store words with repeated letters

function hasRepeatedLetters(word) {
    let letterSet = new Set();
    for (let letter of word) {
        if (letterSet.has(letter)) {
            return true; // Word has repeated letters
        }
        letterSet.add(letter);
    }
    return false; // No repeated letters
}

function probability(list1, array2) {
  let filteredList = list1;
  if (!firstPredictionDone) {
    tempList = filteredList.filter(word => hasRepeatedLetters(word)); // Store words with repeated letters
    filteredList = filteredList.filter(word => !hasRepeatedLetters(word)); // Keep only words without repeated letters
}
    // Function to count occurrences of letters in an array of words
    function countLetters(wordsArray) {
      const letterCounts = {
        0: {},
        1: {},
        2: {},
        3: {},
        4: {}
      };
  
      for (const word of wordsArray) {
        for (let i = 0; i < word.length; i++) {
          const letter = word[i];
          if (letterCounts[i][letter]) {
            letterCounts[i][letter]++;
          } else {
            letterCounts[i][letter] = 1;
          }
        }
      }
  
      return letterCounts;
    }
  
    // Count letters in list1
    const letterCountsList1 = countLetters(filteredList);

  
    // Find the most repeated letter at each index in list1
    const mostRepeatedLetters = Object.keys(letterCountsList1).map(index => {
      const letterCounts = letterCountsList1[index];
      let mostRepeatedLetter = '';
      let maxCount = 0;
  
      for (const letter in letterCounts) {
        if (letterCounts[letter] > maxCount) {
          mostRepeatedLetter = letter;
          maxCount = letterCounts[letter];
        }
      }
      return mostRepeatedLetter;
    });
  
    // Return the 5 most repeated letters as a single word
    concatenatedWord=mostRepeatedLetters.join('');
    const closestMatch = findClosestMatch(concatenatedWord, filteredList);
    if (!firstPredictionDone) {
        firstPredictionDone = true;
        list1 = [...list1, ...tempList]; // Add back words with repeated letters for future predictions
    }
    return closestMatch; 
    
  }
  
  function findClosestMatch(targetWord, list1) {
      function levenshteinDistance(a, b) {
        if (a.length === 0) return b.length;
        if (b.length === 0) return a.length;
    
        const matrix = [];
        for (let i = 0; i <= b.length; i++) {
          matrix[i] = [i];
        }
    
        for (let j = 0; j <= a.length; j++) {
          matrix[0][j] = j;
        }
    
        for (let i = 1; i <= b.length; i++) {
          for (let j = 1; j <= a.length; j++) {
            const cost = a[j - 1] === b[i - 1] ? 0 : 1;
            matrix[i][j] = Math.min(
              matrix[i - 1][j] + 1,
              matrix[i][j - 1] + 1,
              matrix[i - 1][j - 1] + cost
            );
          }
        }
    
        return matrix[b.length][a.length];
      }
    
      let closestMatch = '';
      let minDistance = Infinity;
    
      for (const word of list1) {
        const distance = levenshteinDistance(targetWord, word);
        if (distance < minDistance) {
          minDistance = distance;
          closestMatch = word;
        }
      }
    
      return closestMatch;
    }
  
    function constraint(list1, exit, nonexit) {
      const list2 = [];
      const listinter1 = [];
      const listinter2 = [];
    
      for (const i of list1) {
        let count1 = 0;
        let count2 = 0;
    
        for (const j of exit) {
          if (i.includes(j)) {
            count1++;
          }
        }
    
        if (count1 === exit.length) {
          listinter1.push(i);
        }
    
        for (const k of nonexit) {
          if (!i.includes(k)) {
            count2++;
          }
        }
    
        if (count2 === nonexit.length) {
          listinter2.push(i);
        }
      }
    
      const result = listinter1.filter(word => listinter2.includes(word));
      return result;
    }

  function position(list2, posdict1, posdict2, posdict3, green_letters, uncolored_set) {
    const list4 = [];
    for (const word of list2) {
      let flag = true;
      for (const i in posdict1) {
        if (posdict1[i] !== '') {
          if (posdict1[i] !== word[i]) {
            flag = false;
            break;
          }
        }
      }
      if (flag) {
        list4.push(word);
      }
    }
  
    const list5 = [];
    for (const word of list4) {
      let flag = true;
      for (const i in posdict2) {
        if (posdict2[i] !== '') {
          if (posdict2[i] === word[i]) {
            flag = false;
            break;
          }
        }
      }
      if (flag) {
        list5.push(word);
      }
    }
  
    const list6 = [];
    for (const word of list5) {
      let flag = true;
      for (const i in posdict3) {
        if (posdict3[i] !== '') {
          if (green_letters.has(posdict3[i])) {
            if (posdict3[i] === word[i]) {
              flag = false;
              break;
            }
          }
        }
      }
      if (flag) {
        list6.push(word);
      }
    }
  
    const list7 = [];
    for (const word of list6) {
      if (uncolored_set.length && green_letters.size) {
        let flag = true;
        for (const i of uncolored_set) {
          if (green_letters.has(i)) {
            for (let k = 0; k < 5; k++) {
              if (posdict1[k] === '') {
                if (word[k] === i) {
                  flag = false;
                  break;
                }
              }
            }
          }
        }
        if (flag) {
          list7.push(word);
        }
      } else {
        list7.push(word);
      }
    }
  
    return list7;
  }


